#include <stdio.h>
#include <string.h>
#include <stdlib.h>
#include <unistd.h>


int main(void)
{

	char *string1;
	char *host;
	char *string2 = "";


	size_t len = strlen(string2);
	string1 = malloc(len + 1);
	strcpy(string1, string2);
	
	while ((host = strstr(string1, "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaab"))!=NULL)
	{
		*host = '\0';
		host += 3;
		write(1, host, strlen(host));
		write(1, "\n", 1);
		string1 = host;
		write(1, "was here\n", 9);
	}
	return 0;
	
}
